}
#container {
border-radius: 20px;
-moz-border-radius: 20px;
width: 880px;
background-image: -webkit-gradient(
    linear,
    left top,
    left bottom,
    color-stop(0.17, #4D4D4D),
    color-stop(0.46, #333333),
    color-stop(0.84, #1A1A1A)
);
background-image: -moz-linear-gradient(
    center top,
    #4D4D4D 17%,
    #333333 46%,
    #1A1A1A 84%
);
margin-top: 20px;
margin-bottom: 20px;
padding: 40px;
margin: auto;
z-index: 1;
position: relative;
border: 2px ridge #fdf7f7;
border-left: 2px groove #fdf7f7;
border-top: 2px groove #fdf7f7;
font-family: Georgia, "Times New Roman", Times, serif;
padding-top: 20px;
}

#outer {
